INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES ("リン", 24, 0, 1, "2030/12/17 14:59:59", 10040, 1, 24001, "2020/04/30 12:00:00", 102601, 0.0, 0.0, "あたしだって\nやるときはやるよ！", 0.0);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES ("リン", 24, 1, 1, "2030/12/17 14:59:59", 10040, 1, 24002, "2020/04/30 12:00:00", 102601, 0.0, 0.0, "ふぅ…\nこれであたしの仕事は\n終わりだね", 0.0);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES ("リン", 24, 2, 1, "2030/12/17 14:59:59", 10040, 1, 24003, "2020/04/30 12:00:00", 102601, 0.0, 0.0, "終わった終わった\n一人でもなんとか\nなるもんだね", 0.0);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES ("リン", 24, 3, 2, "2030/12/17 14:59:59", 10040, 2, 24004, "2020/04/30 12:00:00", 102601, 0.0, 0.0, "やったね！\nこれでようやく\nサボれるよ…", 0.0);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES ("リン", 24, 4, 1, "2030/12/17 14:59:59", 10040, 1, 24005, "2020/04/30 12:00:00", 102601, 0.0, 0.0, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 0.0);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES ("リン", 24, 5, 2, "2030/12/17 14:59:59", 10040, 2, 24006, "2020/04/30 12:00:00", 102601, 0.0, 0.0, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 0.0);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES ("リン", 24, 6, 2, "2030/12/17 14:59:59", 10040, 2, 24007, "2020/04/30 12:00:00", 102601, 0.0, 0.0, "あたしも意外と\nやるもんでしょ？", 0.0);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES ("リン", 24, 7, 4, "2030/12/17 14:59:59", 10040, 4, 24008, "2020/04/30 12:00:00", 102601, 0.0, 0.0, "疲れた…\nねずみの逃げ足\n速すぎるよ…", 0.0);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES ("リン", 24, 8, 4, "2030/12/17 14:59:59", 10040, 4, 24009, "2020/04/30 12:00:00", 102601, 0.0, 0.0, "このままじゃ\nまっひ～に\n叱られちゃうよ", 0.0);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES ("リン", 24, 9, 4, "2030/12/17 14:59:59", 10040, 4, 24010, "2020/04/30 12:00:00", 102601, 0.0, 0.0, "まじめに\nやったんだけどな…\n悔しいな～", 0.0);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES ("リン", 24, 10, 4, "2030/12/17 14:59:59", 10040, 4, 24011, "2020/04/30 12:00:00", 102601, 0.0, 0.0, "やられた…\nねずみって意外と\nてごわいね", 0.0);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES ("リン", 24, 11, 4, "2030/12/17 14:59:59", 10040, 4, 24012, "2020/04/30 12:00:00", 102601, 0.0, 0.0, "おのれ～\nあたしのチーズを\n盗みやがって～！", 0.0);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES ("リン", 24, 12, 1, "2030/12/17 14:59:59", 10040, 4, 24013, "2020/04/30 12:00:00", 102601, 0.0, 1.81, "疲れた…\nけど、次こそは\n守り抜くよ…", 0.0);
